en ohne Ihre ausdr√ºckliche Zustimmung nicht an Dritte weitergegeben.</p>\n<p>Wir weisen darauf hin, dass die Daten√ºbertragung im Internet (z.B. bei der Kommunikation per E-Mail) Sicherheitsl√ºcken aufweisen kann. Ein l√ºckenloser Schutz der Daten vor dem Zugriff durch Dritte ist nicht m√∂glich.</p>\n<p>Der Nutzung von im Rahmen der Impressumspflicht ver√∂ffentlichten Kontaktdaten durch Dritte zur √úbersendung von nicht ausdr√ºcklich angeforderter Werbung und Informationsmaterialien wird hiermit ausdr√ºcklich widersprochen. Die Betreiber der Seiten behalten sich ausdr√ºcklich rechtliche Schritte im Falle der unverlangten Zusendung von Werbeinformationen, etwa durch Spam-Mails, vor.</p>\n<p>[nbsp]</p>\n<h3>Datenschutzerkl√§rung f√ºr die Nutzung von Facebook-Plugins (Like-Button)</h3>\n<p>Auf unseren Seiten sind Plugins des sozialen Netzwerks Facebook (Facebook Inc., 1601 Willow Road, Menlo Park, California, 94025, USA) integriert. Die Facebook-Plugins erkennen Sie an dem Facebook-Logo oder dem \"Like-Button\" (\"Gef√§llt mir\") auf unserer Seite. Eine √úbersicht √ºber die Facebook-Plugins finden Sie hier:<a href=\"http://developers.facebook.com/docs/plugins/\" target=\"_blank\">http://developers.facebook.com/docs/plugins/</a>.<br>Wenn Sie unsere Seiten besuchen, wird √ºber das Plugin eine direkte Verbindung zwischen Ihrem Browser und dem Facebook-Server hergestellt. Facebook erh√§lt dadurch die Information, dass Sie mit Ihrer IP-Adresse unsere Seite besucht haben. Wenn Sie den Facebook \"Like-Button\" anklicken w√§hrend Sie in Ihrem Facebook-Account eingeloggt sind, k√∂nnen Sie die Inhalte unserer Seiten auf Ihrem Facebook-Profil verlinken. Dadurch kann Facebook den Besuch unserer Seiten Ihrem Benutzerkonto zuordnen. Wir weisen darauf hin, dass wir als Anbieter der Seiten keine Kenntnis vom Inhalt der √ºbermittelten Daten sowie deren Nutzung durch Facebook erhalten. Weitere Informationen hierzu finden Sie in der Datenschutzerkl√§rung von facebook unter[nbsp]<a href=\"http://de-de.facebook.com/policy.php\" target=\"_blank\">http://de-de.facebook.com/policy.php</a></p>\n<p>Wenn Sie nicht w√ºnschen, dass Facebook den Besuch unserer Seiten Ihrem Facebook-Nutzerkonto zuordnen kann, loggen Sie sich bitte aus Ihrem Facebook-Benutzerkonto aus.</p>\n<p>[nbsp]</p>\n<h3>Datenschutzerkl√§rung f√ºr die Nutzung von Google Analytics</h3>\n<p>Diese Website benutzt Google Analytics, einen Webanalysedienst der Google Inc. (\"Google\"). Google Analytics verwendet sog. \"Cookies\", Textdateien, die auf Ihrem Computer gespeichert werden und die eine Analyse der Benutzung der Website durch Sie erm√∂glichen. Die durch den Cookie erzeugten Informationen √ºber Ihre Benutzung dieser Website werden in der Regel an einen Server von Google in den USA √ºbertragen und dort gespeichert. Im Falle der Aktivierung der IP-Anonymisierung auf dieser Webseite wird Ihre IP-Adresse von Google jedoch innerhalb von Mitgliedstaaten der Europ√§ischen Union oder in anderen Vertragsstaaten des Abkommens √ºber den Europ√§ischen Wirtschaftsraum zuvor gek√ºrzt.</p>\n<p>Nur in Ausnahmef√§llen wird die volle IP-Adresse an einen Server von Google in den USA √ºbertragen und dort gek√ºrzt. Im Auftrag des Betreibers dieser Website wird Google diese Informationen benutzen, um Ihre Nutzung der Website auszuwerten, um Reports √ºber die Websiteaktivit√§ten zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen gegen√ºber dem Websitebetreiber zu erbringen. Die im Rahmen von Google Analytics von Ihrem Browser √ºbermittelte IP-Adresse wird nicht mit anderen Daten von Google zusammengef√ºhrt.</p>\n<p>Sie k√∂nnen die Speicherung der Cookies durch eine entsprechende Einstellung Ihrer Browser-Software verhindern; wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht s√§mtliche Funktionen dieser Website vollumf√§nglich werden nutzen k√∂nnen. Sie k√∂nnen dar√ºber hinaus die Erfassung der durch das Cookie erzeugten und