Facebook-Benutzerkonto aus.</p>\n<p>[nbsp]</p>\n<h3>Datenschutzerkl√§rung f√ºr die Nutzung von Google Analytics</h3>\n<p>Diese Website benutzt Google Analytics, einen Webanalysedienst der Google Inc. (\"Google\"). Google Analytics verwendet sog. \"Cookies\", Textdateien, die auf Ihrem Computer gespeichert werden und die eine Analyse der Benutzung der Website durch Sie erm√∂glichen. Die durch den Cookie erzeugten Informationen √ºber Ihre Benutzung dieser Website werden in der Regel an einen Server von Google in den USA √ºbertragen und dort gespeichert. Im Falle der Aktivierung der IP-Anonymisierung auf dieser Webseite wird Ihre IP-Adresse von Google jedoch innerhalb von Mitgliedstaaten der Europ√§ischen Union oder in anderen Vertragsstaaten des Abkommens √ºber den Europ√§ischen Wirtschaftsraum zuvor gek√ºrzt.</p>\n<p>Nur in Ausnahmef√§llen wird die volle IP-Adresse an einen Server von Google in den USA √ºbertragen und dort gek√ºrzt. Im Auftrag des Betreibers dieser Website wird Google diese Informationen benutzen, um Ihre Nutzung der Website auszuwerten, um Reports √ºber die Websiteaktivit√§ten zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen gegen√ºber dem Websitebetreiber zu erbringen. Die im Rahmen von Google Analytics von Ihrem Browser √ºbermittelte IP-Adresse wird nicht mit anderen Daten von Google zusammengef√ºhrt.</p>\n<p>Sie k√∂nnen die Speicherung der Cookies durch eine entsprechende Einstellung Ihrer Browser-Software verhindern; wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht s√§mtliche Funktionen dieser Website vollumf√§nglich werden nutzen k√∂nnen. Sie k√∂nnen dar√ºber hinaus die Erfassung der durch das Cookie erzeugten und auf Ihre Nutzung der Website bezogenen Daten (inkl. Ihrer IP-Adresse) an Google sowie die Verarbeitung dieser Daten durch Google verhindern, indem sie das unter dem folgenden Link verf√ºgbare Browser-Plugin herunterladen und installieren:[nbsp]<a href=\"http://tools.google.com/dlpage/gaoptout?hl=de\">http://tools.google.com/dlpage/gaoptout?hl=de</a>.</p>\n<p>[nbsp]</p>\n<h3>Datenschutzerkl√§rung f√ºr die Nutzung von Google +1</h3>\n<p>Erfassung und Weitergabe von Informationen:<br>Mithilfe der Google +1-Schaltfl√§che k√∂nnen Sie Informationen weltweit ver√∂ffentlichen. √úber die Google[nbsp]+1-Schaltfl√§che erhalten Sie und andere Nutzer personalisierte Inhalte von Google und unseren Partnern. Google speichert sowohl die Information, dass Sie f√ºr einen Inhalt +1 gegeben haben, als auch Informationen √ºber die Seite, die Sie beim Klicken auf +1 angesehen haben. Ihre +1 k√∂nnen als Hinweise zusammen mit Ihrem Profilnamen und Ihrem Foto in Google-Diensten, wie etwa in Suchergebnissen oder in Ihrem Google-Profil, oder an anderen Stellen auf Websites und Anzeigen im Internet eingeblendet werden.<br>Google zeichnet Informationen √ºber Ihre +1-Aktivit√§ten auf, um die Google-Dienste f√ºr Sie und andere zu verbessern. Um die Google[nbsp]+1-Schaltfl√§che verwenden zu k√∂nnen, ben√∂tigen Sie ein weltweit sichtbares, √∂ffentliches Google-Profil, das zumindest den f√ºr das Profil gew√§hlten Namen enthalten muss. Dieser Name wird in allen Google-Diensten verwendet. In manchen F√§llen kann dieser Name auch einen anderen Namen ersetzen, den Sie beim Teilen von Inhalten √ºber Ihr Google-Konto verwendet haben. Die Identit√§t Ihres Google-Profils kann Nutzern angezeigt werden, die Ihre E-Mail-Adresse kennen oder √ºber andere identifizierende Informationen von Ihnen verf√ºgen.<br><br>Verwendung der erfassten Informationen:<br>Neben den oben erl√§uterten Verwendungszwecken werden die von Ihnen bereitgestellten Informationen gem√§√ü den geltenden Google-Datenschutzbestimmungen genutzt. Google ver√∂ffentlicht m√∂glicherweise zusammengefasste Statistiken √ºber die +1-Aktivit√§ten der Nutzer bzw. gibt diese an Nutzer und Partner weiter, wie etwa Publisher, Inserenten oder verbundene Websites.</p>\n<p>[nbsp]</p>\n<h3>Datenschutzerk